import React, { useState, useEffect } from "react";
import galleryData from "../assets/gallery.json"; // Import the JSON data

const Gallery = () => {
  const [gallery, setGallery] = useState([]);

  // Load gallery images from JSON
  useEffect(() => {
    setGallery(galleryData.images);
  }, []);

  return (
    <div className="bg-gray-100 min-h-screen">
      {/* Heading */}
      <div className="text-center py-10">
        <h1 className="text-4xl font-bold text-gray-800">
          ISKCON Photo Gallery
        </h1>
        <p className="mt-4 text-lg text-gray-600">
          Explore the beauty of ISKCON through photos
        </p>
      </div>

      {/* Photo Gallery */}
      <div className="container mx-auto px-4 py-8">
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
          {gallery.map((image) => (
            <div
              key={image.id}
              className="bg-white shadow-lg rounded overflow-hidden"
            >
              <img
                src={imagesMap[image.src]}
                alt={image.alt}
                className="w-full h-64 object-cover"
              />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Gallery;
